class Dist(Context.Context):
    """Creates an archive containing the project source code."""
    cmd = 'dist'
    fun = 'dist'
    algo = 'tar.bz2'
    ext_algo = {}

    def execute(self):
        """Execute the dist command."""
        self.recurse([os.path.dirname(Context.g_module.root_path)])
        self.archive()

    def archive(self):
        """Archive the project source code."""
        import tarfile
        arch_name = self.get_arch_name()
        try:
            self.base_path
        except AttributeError:
            self.base_path = self.path
        node = self.base_path.make_node(arch_name)
        try:
            node.delete()
        except Exception:
            pass
        files = self.get_files()
        if self.algo.startswith('tar.'):
            tar = tarfile.open(arch_name, 'w:' + self.algo.replace('tar.', ''))
            for x in files:
                self.add_tar_file(x, tar)
            tar.close()
        elif self.algo == 'zip':
            import zipfile
            zip = zipfile.ZipFile(arch_name, 'w', compression=zipfile.ZIP_DEFLATED)
            for x in files:
                archive_name = self.get_base_name() + '/' + x.path_from(self.base_path)
                zip.write(x.abspath(), archive_name, zipfile.ZIP_DEFLATED)
            zip.close()
        else:
            self.fatal('Valid algo types are tar.bz2, tar.gz or zip')
        try:
            from hashlib import sha1 as sha
        except ImportError:
            from sha import sha
        try:
            digest = " (sha=%r)" % sha(node.read()).hexdigest()
        except Exception:
            digest = ''
        Logs.info('New archive created: %s%s' % (self.arch_name, digest))

    def get_tar_path(self, node):
        """Get the tar path."""
        return node.abspath()

    def add_tar_file(self, x, tar):
        """Add a file to the tar archive."""
        p = self.get_tar_path(x)
        tinfo = tar.gettarinfo(name=p, arcname=self.get_tar_prefix() + '/' + x.path_from(self.base_path))
        tinfo.uid = 0
        tinfo.gid = 0
        tinfo.uname = 'root'
        tinfo.gname = 'root'
        fu = None
        try:
            fu = open(p, 'rb')
            tar.addfile(tinfo, fileobj=fu)
        finally:
            if fu:
                fu.close()

    def get_tar_prefix(self):
        """Get the tar prefix."""
        try:
            return self.tar_prefix
        except AttributeError:
            return self.get_base_name()

    def get_arch_name(self):
        """Get the archive name."""
        try:
            self.arch_name
        except AttributeError:
            self.arch_name = self.get_base_name() + '.' + self.ext_algo.get(self.algo, self.algo)
        return self.arch_name

    def get_base_name(self):
        """Get the base name."""
        try:
            self.base_name
        except AttributeError:
            appname = getattr(Context.g_module, Context.APPNAME, 'noname')
            version = getattr(Context.g_module, Context.VERSION, '1.0')
            self.base_name = appname + '-' + version
        return self.base_name

    def get_excl(self):
        """Get the excluded files."""
        try:
            return self.excl
        except AttributeError:
            self.excl = Node.exclude_regs + ' **/waf-1.7.* **/.waf-1.7* **/waf3-1.7.* **/.waf3-1.7* **/*~ **/*.rej **/*.orig **/*.pyc **/*.pyo **/*.bak **/*.swp **/.lock-w*'
            nd = self.root.find_node(Context.out_dir)
            if nd:
                self.excl += ' ' + nd.path_from(self.base_path)
            return self.excl

    def get_files(self):
        """Get the files to include in the archive."""
        try:
            files = self.files
        except AttributeError:
            files = self.base_path.ant_glob('**/*', excl=self.get_excl())
        return files

