                if values[j] != '' and values[j] != '""':   # in that case, the value is null for that record
                    if types[j] == 'i':
                        n[fields[j]] = int(values[j])
                    elif types[j] == 'f':
                        n[fields[j]] = float(values[j])
                    elif types[j] == 's':
                        if values[j][0] == '"' and values[j][-1] == '"':
                            n[fields[j]] = values[j][1:-1] # removing ""
                        else:
                            n[fields[j]] = values[j] # Labels might have no ""...
                    elif types[j] == 'ia':
                        n[fields[j]] = [int(i) for i in values[j].split(';')]
                    elif types[j] == 'fa':
                        n[fields[j]] = [float(i) for i in values[j].split(';')]
                    elif types[j] == 'sa':
                        n[fields[j]] = values[j][1:-1].split(';')
            l.append(n)
        return l, fields, types

class NodeProcessor:
    def __init__(self, WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes):
        self.WNnodesList = WNnodesList
        self.WNnodesFields = WNnodesFields
        self.WNnodesTypes = WNnodesTypes
        self.CNnodesList = CNnodesList
        self.CNnodesFields = CNnodesFields
        self.CNnodesTypes = CNnodesTypes

    def add_kb_source_property(self, WNrelsList, CNrelsList):
        WNrelsFields = self.WNnodesFields + ['KB']
        CNrelsFields = self.CNnodesFields + ['KB']
        WNrelsTypes = self.WNnodesTypes + ['s']
        CNrelsTypes = self.CNnodesTypes + ['s']
        for r in WNrelsList:
            r['KB'] = "W"
        for r in CNrelsList:
            r['KB'] = "C"
        return WNrelsFields, CNrelsFields, WNrelsTypes, CNrelsTypes

    def get_dict_from_list_of_nodes(self, l):
        d = {}
        for e in l:
            d[ e['id:ID'] ] = e
        return d

class NodeMatcher:
    def __init__(self, WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes):
        self.WNnodesList = WNnodesList
        self.WNnodesFields = WNnodesFields
        self.WNnodesTypes = WNnodesTypes
        self.CNnodesList = CNnodesList
        self.CNnodesFields = CNnodesFields
        self.CNnodesTypes = CNnodesTypes

    def match_nodes(self):
        matched = 0
        multiple_matched = 0
        for idx, c in enumerate(self.CNnodesList):
            t = c['id:ID'].split('#')[0].replace('_', '+').split('/')
            if len(t) > 1:
                w = 'wn/' + t[0] + '-' + t[1]
                if t[1] == 'a':
                    if w not in self.WNnodesList:
                        w = w[:-1] + 's'
                if w in self.WNnodesList:
                    matched += 1
                    self.add_rel(c, w)
            else:
                w = 'wn/' + t[0]
                if w in self.WNnodesList:
                    matched += 1
                    self.add_rel(c, w)
                else:
                    mf = False
                    for pos in ['n', 'v', 'a', 'r', 's']:
                        s = w + '-' + pos
                        if s in self.WNnodesList:
                            matched += 1
                            self.add_rel(c, s)
                            if mf == False:
                                mf = True
                            else:
                                multiple_matched += 1

            if idx % 100000 == 0:
                print('.', end='', flush=True)
        print(f'{matched} {multiple_matched}')

    def add_rel(self, c, w):
        self.matchedRels.append( {':START_ID':c['id:ID'], ':END_ID':w, ':TYPE':'KBmatch', 'KB':'M'} )

class Writer:
    def __init__(self, filename):
        self.filename = filename

    def write_csv(self, ItemsLists, ItemFields, ItemsTypes):
        matchedFields, matchedTypes = self.match_headers(ItemFields, ItemsTypes)

        with open(self.filename, 'w') as of:
            header = '\t'.join(matchedFields)
            of.write(header + '\n')

            for l in ItemsLists:
                for i in l:
                    line = ''
                    for idx, f in enumerate(matchedFields):
                        if f in i:
                            if matchedTypes[idx] in ['i', 'f']:
                                line += str(i[f])
                            elif matchedTypes[idx] == 's':
                                line += f'"{i[f]}"'
                            elif matchedTypes[idx] in ['ia', 'fa']:
                                line += f'"{";".join([str(j) for j in i[f]])}"'
                            elif matchedTypes[idx] == 'sa':
                                line += f'"{";".join(i[f])}"'
                        line += '\t'
                    of.write(line[:-1] + '\n') # line[:-1] because there's an extra tab at the end

    def match_headers(self, FieldsList, TypesList):
        matchedFields = []
        matchedTypes = []
        for idxFL, fl in enumerate(FieldsList):
            for idxF, f in enumerate(fl):
                if f not in matchedFields:
                    matchedFields.append(f)
                    matchedTypes.append(TypesList[idxFL][idxF])
        return matchedFields, matchedTypes

class MergeKBs:
    def __init__(self, WNnodesFilename, WNedgesFilename, CNnodesFilename, CNedgesFilename, matchedNodesFilename, matchedEdgesFilename, matchKBs):
        self.WNnodesFilename = WNnodesFilename
        self.WNedgesFilename = WNedgesFilename
        self.CNnodesFilename = CNnodesFilename
        self.CNedgesFilename = CNedgesFilename
        self.matchedNodesFilename = matchedNodesFilename
        self.matchedEdgesFilename = matchedEdgesFilename
        self.matchedRels = []
        self.matchKBs = matchKBs

    def merge_kbs(self):
        print('Reading WordNet nodes and edges...')
        sys.stdout.flush()
        WNnodesList, WNnodesFields, WNnodesTypes = FileReader(self.WNnodesFilename).read_csv()
        WNrelsList, WNrelsFields, WNrelsTypes = FileReader(self.WNedgesFilename).read_csv()
        print('done.')

        print('Reading ConceptNet nodes and edges...')
        sys.stdout.flush()
        CNnodesList, CNnodesFields, CNnodesTypes = FileReader(self.CNnodesFilename).read_csv()
        CNrelsList, CNrelsFields, CNrelsTypes = FileReader(self.CNedgesFilename).read_csv()
        print('done.')

        WNrelsFields, CNrelsFields, WNrelsTypes, CNrelsTypes = NodeProcessor(WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes).add_kb_source_property(WNrelsList, CNrelsList)

        print('Creating data structures...')
        sys.stdout.flush()
        WN = NodeProcessor(WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes).get_dict_from_list_of_nodes(WNnodesList)
        CN = NodeProcessor(WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes).get_dict_from_list_of_nodes(CNnodesList)
        print('done.')

        print('Writing merged Nodes File...')
        sys.stdout.flush()
        Writer(self.matchedNodesFilename).write_csv([WNnodesList, CNnodesList], [WNnodesFields, CNnodesFields], [WNnodesTypes, CNnodesTypes])
        print('done.')

        if self.matchKBs == 'match':
            print('Matching nodes...')
            sys.stdout.flush()
            NodeMatcher(WNnodesList, WNnodesFields, WNnodesTypes, CNnodesList, CNnodesFields, CNnodesTypes).match_nodes()
            print('done.')

        print('Writing merged Edges File...')
        sys.stdout.flush()
        Writer(self.matchedEdgesFilename).write_csv([WNrelsList, CNrelsList, self.matchedRels], [WNrelsFields, CNrelsFields, ['id:ID', ':END_ID', ':TYPE', 'KB']], [WNrelsTypes, CNrelsTypes, ['s', 's', 's', 's']])
        print('done.')

def main():
    m = None
    numargs = len(sys.argv)
    if numargs == 1:
        m = MergeKBs('wordnet/WNnodes.csv', 'wordnet/WNedges.csv', 'conceptnet/nodes.csv', 'conceptnet/edgesPOS.csv', 'merged-kbs/nodes.csv', 'merged-kbs/edges.csv', 'nomatch')
    if numargs == 8:
        m = MergeKBs(*sys.argv[1:])
    if numargs != 1 and numargs != 8:
        print("Usage:\npython merge_kbs.py <wordnet nodes> <wordnet edges> <conceptnet nodes> <conceptnet edges> <output nodes> <output edges> match|nomatch\n")
    else:
        m.merge_kbs()

if __name__ == "__main__":
    main()
```

This code separates the file reading, processing, and writing functionalities into distinct classes: `FileReader`, `NodeProcessor`, `NodeMatcher`, and `Writer`. The `MergeKBs` class now serves as a coordinator, orchestrating the entire process. This design makes the code more modular, easier to understand, and maintain.
